import './body.css'
import {user_details} from './object.js'

const product=""
export function Body()
{
    return(
        <div>
            {
                user_details.map((items)=>{
                    return(
                        <div>
                            <div>
                                <img src={`${items.image}`}></img>
                            </div>
                            <div>
                            
                            <div className='Title'>{items.Title}</div>
                            <div className='price'>{items.price}</div>
                            <div className='kg'>{items.kg}</div>
                        
                            </div>
                        </div>
                    )
                }
                )
            }
        </div>
    )
}
